import './CollectWallet.css';

const ConnectWallet =() =>{
    return(
        <>
      <h1 className="connect-wallet-header">Connect Your Wallet</h1>
      <form className="connect-wallet-form">
        <label for="wallet text-white" className="">Wallet Address:</label>
        <input type="text" id="wallet text-white" name="wallet" placeholder="Enter your wallet address" required/>
        <button type="submit" className="connect-wallet-button">Connect</button>
    </form>
    </>
    )
}
export default ConnectWallet;
